import React, { useEffect, useState } from "react";
import axios from "axios";
import { Link } from "react-router-dom";

const JobListings = () => {
  const [jobs, setJobs] = useState([]);
  const [filters, setFilters] = useState({ location: "", skill: "", salaryMin: "", salaryMax: "" });
  const [loading, setLoading] = useState(false);

  const fetchJobs = async () => {
    setLoading(true);
    try {
      const params = {};
      if (filters.location) params.location = filters.location;
      if (filters.skill) params.skill = filters.skill;
      if (filters.salaryMin) params.salaryMin = filters.salaryMin;
      if (filters.salaryMax) params.salaryMax = filters.salaryMax;
      const res = await axios.get(process.env.REACT_APP_API_URL + "/jobs", { params });
      setJobs(res.data.data);
    } catch (err) {
      setJobs([]);
    }
    setLoading(false);
  };

  useEffect(() => {
    fetchJobs();
    // eslint-disable-next-line
  }, []);

  const handleFilterChange = (e) => {
    setFilters({ ...filters, [e.target.name]: e.target.value });
  };

  const handleFilterSubmit = (e) => {
    e.preventDefault();
    fetchJobs();
  };

  return (
    <div>
      <h2 className="text-2xl font-bold mb-4">Job Listings</h2>
      <form className="flex flex-wrap gap-4 mb-6" onSubmit={handleFilterSubmit}>
        <input name="location" value={filters.location} onChange={handleFilterChange} placeholder="Location" className="border rounded px-3 py-2" />
        <input name="skill" value={filters.skill} onChange={handleFilterChange} placeholder="Skill" className="border rounded px-3 py-2" />
        <input name="salaryMin" value={filters.salaryMin} onChange={handleFilterChange} placeholder="Min Salary" type="number" className="border rounded px-3 py-2 w-32" />
        <input name="salaryMax" value={filters.salaryMax} onChange={handleFilterChange} placeholder="Max Salary" type="number" className="border rounded px-3 py-2 w-32" />
        <button type="submit" className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700">Filter</button>
      </form>
      {loading ? (
        <div>Loading jobs...</div>
      ) : jobs.length === 0 ? (
        <div>No jobs found.</div>
      ) : (
        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-6">
          {jobs.map((job) => (
            <div key={job._id} className="bg-white rounded shadow p-4 flex flex-col justify-between">
              <div>
                <h3 className="text-lg font-semibold mb-1">{job.title}</h3>
                <div className="text-gray-600 mb-2">{job.company?.name} &middot; {job.location?.city}, {job.location?.country}</div>
                <div className="mb-2 text-sm text-gray-500">{job.summary}</div>
                <div className="mb-2 text-xs text-gray-400">Skills: {job.requirements?.skills?.join(", ")}</div>
                <div className="mb-2 text-xs text-gray-400">Salary: {job.salary?.currency} {job.salary?.min} - {job.salary?.max}</div>
              </div>
              <Link to={`/apply/${job._id}`} className="mt-4 inline-block bg-green-600 text-white px-4 py-2 rounded hover:bg-green-700 text-center">Apply</Link>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default JobListings;
